CREATE TABLE stock_prices (
    symbol VARCHAR(10) NOT NULL,
    price DECIMAL(10,2) NOT NULL,
    timestamp TIMESTAMP NOT NULL
);

CREATE TABLE stocks (
stock_id INT PRIMARY KEY,
stock_name VARCHAR(255),
stock_price DECIMAL(10,2)
);

CREATE TABLE trading_strategies (
strategy_id INT PRIMARY KEY,
strategy_name VARCHAR(255),
strategy_description TEXT
);

CREATE TABLE stock_price (
    symbol VARCHAR(10),
    price DECIMAL(10, 2),
    date DATE
);

CREATE TABLE trading_strategy (
    strategy_id INT,
    description TEXT,
    author VARCHAR(50)
);

CREATE TABLE stock_tickers (
  ticker_symbol VARCHAR(10) PRIMARY KEY,
  company_name VARCHAR(100) NOT NULL,
  exchange VARCHAR(50) NOT NULL
);

CREATE TABLE stock_prices (
  price_id SERIAL PRIMARY KEY,
  ticker_symbol VARCHAR(10) REFERENCES stock_tickers(ticker_symbol),
  price DECIMAL NOT NULL,
  timestamp TIMESTAMP NOT NULL
);

CREATE TABLE trading_strategies (
  strategy_id SERIAL PRIMARY KEY,
  strategy_name VARCHAR(50) NOT NULL,
  description TEXT
);

CREATE TABLE strategy_prices (
  price_id SERIAL PRIMARY KEY,
  strategy_id INT REFERENCES trading_strategies(strategy_id),
  price DECIMAL NOT NULL,
  timestamp TIMESTAMP NOT NULL
);

CREATE TABLE stocks (
    stock_id INT,
    stock_name VARCHAR,
    stock_price FLOAT
);

CREATE TABLE strategies (
    strategy_id INT,
    strategy_name VARCHAR,
    strategy_description TEXT
);

CREATE TABLE users (
    user_id INT,
    user_name VARCHAR,
    user_email VARCHAR
);
